(34, 2, 76, 2, 'Bagaimana Cara Memulai Usaha Modal Kecil ?', 'bagaimana-cara-memulai-usaha-modal-kecil', '2013/08/15/20130815_132923_5731.jpg', 'fdgdf', '<p>Mendirikan sebuah usaha jadi solusi alternatif saat krisis ekonomi telah melilit bangsa Indonesia. Terus bagaimanakah cara memulai usaha modal kecil yang mudah dan aplikatif?</p>\n<p>&nbsp;</p>\n<p>Bisnis terkadang bergantung pada besarnya modal dalam meraup keuntungan. Sebab banyak faktor yang dapat diraih dengan cepat bila modal yang tersedia cukup besar. Akan tetapi mempunyai modal sedikit ataupun tak bermodal tidak menutup kemungkinan seseorang untuk sukses besar dalam berbisnis.<br /><br />Berikut ini beberapa tips memulai usaha modal kecil antara lain:<br /><br /></p>', '<p><br /><strong>1. Pilih jenis usaha yang butuh modal kecil bahkan gratisan</strong><br /><br />Banyak jenis bisnis yang hanya memerlukan modal kecil, semisal bisnis pulsa, bisnis makanan ringan, bisnis minuman ringan, dan sebagainya. Sementara untuk bisnis tanpa modal bisa diwujudkan dengan keahlian tertentu seperti bisnis di internet, usaha jasa les-lesan, pemijatan dan lainnya.<br /><br /><strong>2. Ajukan proposal bisnis</strong><br /><br />Membuat proposal bisnis yang realistis dan punya prospek menjajikan dapat menjadi kunci dalam memperoleh modal dari investor. Tentu saja membuat proposal usaha harus memperhatikan banyak hal. Seperti ide bisnis yang lagi trend/menguntungkan, pendirian usaha, modal yang dibutuhkan, pengelolaan usaha dan sebagainya.<br /><br /><strong>3. Patungan usaha</strong><br /><br />Sejumlah modal kecil bila dijumlahkan akan menjadi besar totalnya, sehingga ini jalan bagi Anda yang ingin berbisnis dengan kenalan atau rekan kerja di kantor.<br /><br /><br /></p>', '<p>&nbsp;</p>\n<p>Sampai di sini sharing bisnis kita dan selamat memulai usaha baru!</p>', 'Ilustated', '2013-08-14 00:01:00'),
(32, 2, 12, 2, 'Siap Untuk Wawancara Kerja', 'siap-untuk-wawancara-kerja', '2013/07/24/20130724_064228_3064.jpg', 'sds', '<p>Interaksi atau komunikasi yang menyangkut dua pihak dan mempunyai tujuan, dapat disebut sebagai wawancara. Dan dalam kesempatan ini saya ingin menyampaikan tentang bagaimana menghadapi wawancara kerja.<br /><br />"An interview is an interactional communication process between two parties, at least one of whom has a predetermined and serious purpose, and usually involves the asking and answering of questions" &ndash; Stewart &amp; Cash, 2000.<br /><br />Ada beberapa aspek yang terdapat dalam wawancara, yaitu :<br /><br /></p>\n<ol>\n<li>Proses komunikasi interaksional antara dua pihak.</li>\n<li>Pertukaran informasi yang dilakukan secara verbal dan nonverbal</li>\n<li>Mempunyai tujuan tertentu yang spesifik.</li>\n</ol>\n<p><br />Tahap Wawancara bagi para pencari kerja<br /><br />Dalam penerimaan tenaga kerja, wawancara merupakan salah satu tahap proses seleksi. Memastikan apakah calon tenaga kerja sesuai dengan hasil test sebelumnya (jika ada. Ex. Psikotest), bertemu secara langsung, mengetahui cara berpikir dan sikap kerja calon karyawan tersebut serta mendapatkan kesesuaian antara cv yang perusahaan terima dengan kemampuan yang dimilikinya, merupakan inti dari proses wawancara.<br /><br />Persiapan yang baik adalah kunci dari keberhasilan. Jangan sampai wawancara kerja yang merupakan gerbang utama bagi pencari kerja untuk meraih pekerjaan yang diinginkan malah menjadi kacau karena anda tidak mempersiapkannya dengan matang. Dengan melakukan persiapan yang baik, maka peluang untuk diterima bekerja akan lebih besar. Berpenampilan rapih, tampak profesional dan mengenakan pakaian yang tepat merupakan aspek pertama yang sangat penting.<br /><br />Beberapa benda yang wajib di persiapkan oleh Pencari kerja untuk wawancara<br /><br /><strong>1. Catatan Nomor Telepon Perusahaan</strong><br /><br />Pastikan waktu, tempat dan siapa yang harus di temui atau di hubungin untuk proses wawancara. Kita tidak akan pernah tahu apa yang akan terjadi selama perjalanan menuju tempat anda wawancara. Dengan memiliki nomor telepon perusahaan anda bisa menginformasikan apabila ada kendala yang terjadi.<br /><br /><strong>2. Surat Referensi</strong><br /><br />Apabila memiliki surat referensi, bawalah secara terpisah dengan resume anda.<br /><br /><strong>3. Resume</strong><br /><br />Pelajari kembali CV anda dan fokuskan pada bagian-bagian yang relevan dengan posisi yang anda lamar. Pada saat anda dipanggil interview, ada beberapa perusahaan yang sudah memegang resume anda.Tetapi alangkah baiknya apabila anda membawa resume anda sendiri untuk persiapan apabila diperlukan.<br /><br /><strong>4. Pulpen</strong><br /><br />Bagi pencari kerja terkadang saat melakukan wawancara kerja, ada beberapa berkas yang harus anda isi dan serahkan ke perusahaan. Membawa dan memiliki pulpen sendiri dan tidak meminjam pada pewawancara berarti bahwa anda sudah menyiapkan diri ada dengan baik, dan ada beberapa pewawancara yang menilai hal kecil tersebut.<br /><br />Dalam melakukan wawancara kerja, selain hal-hal fisik tersebut di atas, pencari kerja pun harus mempersiapkan mental yang merupakan hal yang tak kalah penting. Menunjukkan sikap canggung dan tidak percaya diri mempengaruhi penilaian anda. Usahakanlah untuk selalu percaya diri, dan tenang. Memberikan senyuman dan rileks pada saat interview dapat membantu anda untuk menjawab pertanyaan &ndash;pertanyaan dari interviewer dengan baik.<br /><br />Selamat mencoba.<br /><br /></p>', '', '<p>&nbsp;</p>\n<p>Salam,<br />Dwi Putro Widodo S.Psi.MM<br />Recruitment and Development Dept.<br />PT. BNI Life Insurance</p>', 'bfs', '2013-07-24 00:00:00'),
(21, 1, 8, 2, 'Tonga Kehilangan Bantuan Pariwisata Ribuan Dollar', 'tonga-kehilangan-bantuan-pariwisata-ribuan-dollar', '2013/07/09/20130709_221617_4968.jpg', '', '<p><span>Pemerintah Selandia Baru memutuskan menunda bantuan pariwisata senilai jutaan dolar untuk Tonga menyusul kekhawatiran terhadap keselamatan layanan penerbangan domestik di negara itu.</span><br /><br /><span>Akhir pekan lalu, Tonga menerima&nbsp; hibah pesawat&nbsp; Xian MA60 buatan China untuk maskapai domestik Real Tonga dari pemerintah China. Tapi pesawat itu&nbsp; dikenal sebagai pesawat dengan catatan standar keselamatan penerbangan terburuk di dunia.</span><br /><br /><span>Khawatir dengan penggunaan pesawat&nbsp; ini, pemerintah Selandia Baru memutuskan menunda bantuannya untuk sektor pariwisata di Tonga. Bahkan situs otoritas resmi Selandia Baru sudah menerbitakan larangan&nbsp; bepergian atau&nbsp;</span><em>travel warning.</em></p>', '', '', '', '2013-07-08 00:00:00'),
(22, 1, 2, 2, 'Hotel Bintang Lima Disatroni Pencuri', 'hotel-bintang-lima-disatroni-pencuri', '2013/07/09/20130709_221536_1183.jpg', '', '<p><span>Jangan pernah beranggapan ada kepastian keamanan saat menginap di sebuah hotel bintang lima. Seorang pencuri mengelabui staf hotel dan membuka&nbsp;</span><em>safe deposit</em><span>&nbsp;milik tamu hotel. Uang dan barang senilai 50 ribu dollar Hongkong, setara Rp 64 juta, amblas.</span><br /><br /><span>Kini polisi berupaya melacak pencuri yang praktis tidak perlu bekerja keras meraup hasil curiannya. Kantor berita&nbsp;</span><em>AFP</em><span>, Selasa (9/7/2013), mengutip harian Hongkong,&nbsp;</span><em>South China Morning Post</em><span>&nbsp;</span><em>(SCMP)</em><span>, melaporkan seorang pegawai hotel Peninsula di tepian pelabuhan Hongkong didekati si pencuri yang meminta kunci cadangan, Minggu (7/7/2013) dini hari.</span><br /><br /><span>Saat itu, sepasang suami istri asal Perancis sedang tidur di kamarnya. Pada siang harinya, pasangan tersebut keluar kamar, dan si pencuri masuk ke kamar tersebut. Dari dalam kamar, si pencuri menghubungi petugas hotel, meminta bantuan membuka&nbsp;</span><em>safe deposit</em><span>, seakan dia pemiliknya.</span></p>', '', '', '', '2013-07-08 00:00:00'),
(23, 1, 76, 2, 'Cara Bekerja Aman dan Nyaman Dengan Komputer', 'cara-bekerja-aman-dan-nyaman-dengan-komputer', '2013/08/15/20130815_134908_7115.jpg', '', '<p>Perkembangan teknologi informasi semakin melekatkan kegiatan kerja dengan alat-alat digital yang canggih, semisal komputer, laptop, printer, dan sebagainnya. Lalu bagaimanakah cara bekerja yang aman dan nyaman dengan komputer?</p>', '<p>Bagi mereka yang setiap hari duduk di depan komputer penting untuk menyimak beberapa tips bekerja dengan komputer ini. Sebab pengaruh negatif dari komputer terhadap kesehatan perlu untuk dihindari sebisa mungkin.<br /><br /><strong>1. Jangan paksa mata Anda</strong><br /><br />Menatap layar komputer atau laptop dengan intensitas yang lama tentu akan membuat kedua mata terasa lelah. Belum lagi pengaru radiasi monitor terhadap mata, semakin menambah berat mata bila kelamaan menatap layar komputer. Maka istirahatkan mata Anda beberapa detik ketika terasa sudah sedikit lelah, dengan melihat ke arah selain monitor. Bisa saja Anda mengalihkan pandangan ke jendela luar kantor.<br /><br /><strong>2. Rileksasi</strong><br /><br />Mungkin yang paling terasa capek bila bekerja duduk dengan komputer adalah punggung dan kedua tangan. Maka sekali-kali Anda berdiri dan berjalan santai di kantor atau tempat kerja. Trik ini membuat punggung kembali pada posisi semula dari duduk membungkuk. Atau bisa dengan menarik kedua tangan keatas sambil menghirup udara sekuat mungkin dan melepaskannya.<br /><br /><strong>3. Pilih layar yang berkualitas</strong><br /><br />Radiasi setiap monitor dari sejumlah produsen akan berbeda-beda, biasanya tergantung pada harga jualnya. Pilihlah layar dengan kualitas tinggi agar mata dan tubuh Anda terhindar dari efek negatif.<br /><br /><strong>4. Libur sepenuhnya</strong><br /><br />Di hari sabtu dan minggu Anda harus memastikan putus hubungan sementara dengan alat komputer ini. Tujuannya agar badan kembali segar tanpa ada rasa beban kerja berlebihan, apalagi cukup membosankan bila setiap hari mengamati layar komputer atau laptop. Boleh saja berhubungan dengan komputer pada hari libur namun hanya untuk keperluan yang penting.<br /><br />Sekian tips bekerja dengan komputer atau laptop, semoga bermanfaat!</p>', '', 'Image by doan photo', '2013-07-09 00:00:00'),
(24, 1, 76, 2, 'Mahasiswa Produktif, Kuliah Sambil Berbisnis!', 'mahasiswa-produktif-kuliah-sambil-berbisnis', '2013/08/15/20130815_135221_4063.jpg', '', '<p>Memulai sebuah bisnis tidak perlu menunggu sesudah lulus nanti, semua mahasiswa dapat membangun bisnis dengan cepat dan modal yang terjangkau.</p>', '<p>Mental berbisnis berbeda dengan mental para pekerja kantoran ataupun di industri. Para pengusaha lebih banyak memikirkan cara membangun bisnis, mengelolanya, memasarkan produk sekaligus mengembangkannya. Sementara itu karyawan berpikiran lebih enak, atau mempunyai paradigma bahwa bekerja kepada orang lain itu jauh dari resiko kegagalan.<br /><br />Memang benar mahasiswa yang ingin memulai bisnis pasti terganjal dengan angan-angan kegagalan. Namun ubah pandangan Anda terhadap kata &lsquo;kegagalan&rsquo;. Seseorang yang tak pernah melakoni dunia usaha sebenarnya juga sudah gagal berbisnis walaupun kebanyakan mereka tak sadar. Berbeda dengan para pengusaha yang mengalami kegagalan lalu belajar dari kepahitan itu, untuk kemudian menemukan ide, cara bisnis, pengelolaan dan manajemen usaha yang lebih baik.<br /><br />Temukan ide bisnis yang cocok bagi Anda sebagai mahasiswa. Setidaknya bisnis yang tidak membutuhkan modal yang begitu besar. Seperti bisnis bimbingan belajar, terjemahan, penulisan, ataupun yang lainnya. Setelah itu pelajari cara meningkatkan omzet dan marketing sebuah bisnis dari berbagai literatur.<br /><br />Sampai sekian sharing bisnis mahasiswa ini dan selamat membuka usaha!</p>', '', 'Image by doan photo', '2013-07-09 00:00:00'),
(25, 1, 76, 2, 'Kiat Ringan Menjadi Pengusaha Sukses', 'kiat-ringan-menjadi-pengusaha-sukses', '2013/08/15/20130815_135553_3958.jpg', '', '<p>Ada banyak cara menuju derajat pengusaha yang berhasil, namun sebagian orang menempuhnya dengan mudah. Tapi itu tampaknya saja gampang saat sudah mencapai kesuksesan. Sebenarnya membutuhkan proses yang berliku-liku untuk mengembangkan bisnis hingga sukses.</p>\n<p>Kiat menjadi pengusaha sukses kuncinya terletak pada seberapa tingkat pengetahuan bisnis yang Anda miliki. Di sini tidak berbicara pada kuantitas pengetahuan, namun lebih spesifik yakni penguasaan bidang bisnis yang ditekuni.</p>', '<p>Pembaca tentu mengenal om Bob Sadino yang sukses besar dengan bermacam-macam bisnisnya. Namun beliau memulai keberhasilan besar setelah menekuni dengan serius bidang agrobisnis. Setelah itu barulah beliau memperlebar sayap usahanya yang bermacam-macam.<br /><br />Boleh saja Anda memiliki banyak usaha, karena itu dapat memperbesar jaringan pendapatan tiap bulan. Namun seorang pengusaha besar pasti memiliki usaha inti yang menghasilkan sebagian besar pemasukan darinya. Sementara bisnis sampingan yang banyak ibarat ranting yang membantu pembesaran batang utama pohon (bisnis inti).<br /><br />Cukup sekian tips ringan berbisnis hari ini, selamat berwiraswasta!</p>', '', 'Image by doan photo', '2013-07-09 00:00:00'),
(27, 1, 3, 2, 'Ponsel Pintar Bisa Gantikan Sopir', 'ponsel-pintar-bisa-gantikan-sopir', '2013/07/09/20130709_230708_2861.jpg', '', '<p><span>Tiga mahasiswa dari Australia memberi wacana baru dalam teknologi mobil otomatis yang bisa berjalan tanpa pengemudi. Mereka menggunakan ponsel pintar untuk mengendalikan mobil tersebut.</span><br /><br /><span>Ketiga mahasiswa itu adalah Tommi Sullivan, Michael Lennon, dan Yukito Tsunoda, yang berasal dari jurusan teknologi dan informasi Universitas Griffith, Queensland, Australia.</span><br /><br /><span>Mereka membuat purwarupa mobil mainan yang dibekali pedal. Ponsel pintar dipasangkan di bagian depan mobil. Dua fitur pada ponsel pintar ini dimanfaatkan, yakni kamera dan GPS. Kamera digunakan untuk mengidentifikasi jalur, sedangkan GPS untuk navigasi.</span><br /><br /><span>"Sebuah kendaraan tak berawak biasanya menggunakan kamera atau sensor yang berbeda, atau Ladar (Light Detection And Ranging) di atas. Tetapi keunikan dalam mobil ini, adalah sebagian besar sensor yang digunakan berasal dari ponsel pintar," kata Sullivan seperti dikutip dari CNet.</span></p>', '', '', '', '2013-07-09 01:00:00'),
(28, 1, 9, 2, 'Rekor, Tim Ini Kalahkan Lawannya 79-0', 'rekor-tim-ini-kalahkan-lawannya-79-0', '2013/07/09/20130709_230816_2007.jpg', '', '<p><span>Rekor skor terbesar tercipta dalam sebuah pertandingan Liga Amatir Nigeria Divisi Empat atau kasta keenam Liga Nigeria. Dua pertandingan&nbsp;</span><em>play-off</em><span>&nbsp;antara Police Machine lawan Bubayaro dan Plateau United Feeders lawan Akurba FC menghasilkan 146 gol.</span><br /><br /><span>Jelang kompetisi berakhir, Police Machine dan Plateau United Feeders memiliki poin sama sehingga selisih gol menentukan tim mana yang berpromosi ke Nationwide Amateur League atau kasta kelima Liga Nigeria. Maka, baik Police Machine maupun Plateau United Feeders dituntut menang dan mencetak gol sebanyak mungkin pada laga terakhir mereka untuk mendapatkan tiket promosi.</span><br /><br /><span>Ambisi kedua tim memang tercapai, bahkan jauh di luar dugaan. Pada laga terakhirnya, Police Machine berhasil mengalahkan Bubayaro dengan skor fantastis 67-0. Namun, skor fantastis itu ternyata masih belum cukup. Sebab, di pertandingan lain, Plateau United Feeders berhasil meraih kemenangan dengan skor yang jauh lebih fantastis. Plateaua mampu menggunduli Akurba FC dengan skor 79-0.</span></p>', '', '', '', '2013-07-09 02:00:00'),
(31, 2, 11, 2, 'Yuk intip gaji Pegawai negeri sipil tahun 2013', 'yuk-intip-gaji-pegawai-negeri-sipil-tahun-2013', '2013/07/24/20130724_062309_1759.jpg', '', '<p><strong>Jakarta</strong> - Presiden Susilo Bambang Yudhoyono (SBY) telah mengeluarkan Peraturan Pemerintah (PP) nomor 22 tahun 2013 tentang pengubahan kelima belas atas PP nomor 7 tahun 1977 tentang peraturan gaji Pegawai Negeri Sipil (PNS). <br /><br />PP yang ditandatangani pada 11 April 2013 ini berisi informasi mengenai daftar kenaikan gaji PNS tahun 2013.<br /><br />Dikutip <strong>detikFinance</strong>, Senin (29/4/2013) dari publikasi PP No.22 Tahun 2013 Tentang Peraturan Besaran Gaji Pokok PNS 2013, terdapat daftar gaji PNS golongan I sampai IV. <br /><br />Gaji paling tinggi yakni PNS golongan IVe di mana mencapai Rp 5 juta. Sedangkan PNS untuk golongan Ia atau terendah sebesar Rp 1,32 juta.<br /><br />"Bahwa dalam rangka meningkatkan daya guna dan hasil huna serta kesejahteraan PNS, perlu menaikkan gaji pokok PNS," demikian tulis SBY dalam pertimbangannya dalam PP tersebut.<br /><br />Berikut daftar gaji terbaru gaji PNS sesuai PP nomor 22 tahun 2013:<br /><br /><strong>Golongan Ia :</strong><br />Masa Kerja Golongan/MKG 0 (terendah) Rp 1.323.000<br />Masa Kerja Golongan/MKG 26 (tertinggi) Rp 1.979.900<br /><br /><strong>Golongan Ib</strong><br />Masa Kerja Golongan/MKG 3 (terendah) Rp 1.444.800<br />Masa Kerja Golongan/MKG 27 (tertinggi) Rp 2.096.100<br /><br /><strong>Golongan Ic</strong><br />Masa Kerja Golongan/MKG 3 (terendah) Rp 1.505.900<br />Masa Kerja Golongan/MKG 27 (tertinggi) Rp 2.184.800<br /><br /><strong>Golongan Id</strong><br />Masa Kerja Golongan/MKG 3 (terendah) Rp 1.569.600<br />Masa Kerja Golongan/MKG 27 (tertinggi) Rp 2.277.200<br /><br /><strong>Golongan IIa</strong><br />Masa Kerja Golongan/MKG 0 (terendah) Rp 1.714.100<br />Masa Kerja Golongan/MKG 33 (tertinggi) Rp 2.859.500<br /><br /><strong>Golongan IIb</strong><br />Masa Kerja Golongan/MKG 3 (terendah) Rp 1.871.900<br />Masa Kerja Golongan/MKG 33 (tertinggi) Rp 2.980.500<br /><br /><strong>Golongan IIc</strong><br />Masa Kerja Golongan/MKG 3 (terendah) Rp 1.951.100<br />Masa Kerja Golongan/MKG 33 (tertinggi) Rp 3.106.000<br /><br /><strong>Golongan IId</strong><br />Masa Kerja Golongan/MKG 3 (terendah) Rp 2.033.600<br />Masa Kerja Golongan/MKG 33 (tertinggi) Rp 3.238.000<br /><br /><strong>Golongan IIIa</strong><br />Masa Kerja Golongan/MKG 32 (tertinggi) Rp 3.590.900</p>', '<p>dfdfsdf</p>', '<p>fsdfdsfsd</p>', 'ilustrasi', '2013-07-24 00:00:00');
