(9, 1, 'Ngabuburit Aseek At Jazz Corner', 'ngabuburit-aseek-at-jazz-corner', '<p><span>Ngalamers ada rencana apa nih untuk menunggu waktu buka puasa? Jika belum ada rencana yuk datang ke Jazz Corner Cafe karena disana bakal ada event&nbsp;</span><span>Ngabuburit Aseek At Jazz Corner</span><span>.</span></p>', '2013/07/09/20130709_231741_2582.jpg', 'Ngabuburit Aseek At Jazz Corner', 'Jazz Corner Cafe, Jl. Bogor 2 Malang', '2013-07-13 00:00:00', '', '2013-07-09 00:00:15'),
(10, 1, 'Festival Sukses Mulia 2013', 'festival-sukses-mulia-2013', '<p>Ayo,berpartisipasi bersama pecah kan Rekor MURI bersama 10.000 peserta, 200 pembicara di 20 kota seluruh Indonesia. Satukan semangat dan langkah menyambut dimulainya era baru. Era &lrm;#SUKSESMULIA<br /><br />Fasilitas:</p>\n<ul>\n<li>Sertifikat</li>\n<li>Pameran UKM</li>\n<li>Pameran komunitas</li>\n<li>Free konsultasi</li>\n<li>Stand up comedy</li>\n</ul>\n<p>Pembicara :<br />1. Ridwan Abadi (TDA Ngalam,Owner Batagor Jepang)<br />2. Doddy Bening (Pro. Fotografer, Bening Studio)<br />3. Heru Tomo (Writer)<br />4. Faizal SurpluS MBA (Motivator Nasional)<br />5. Iwan (Inspirator Hidup Lebih Bermakna)<br />6. Romy Irawan (wakil himpunan pengusaha se Malang Raya)<br />7. Zulianto (TeacherPreneur)<br />8. Sakti SP (Provokator Motivasi)<br />9. Fatimah (Sosial-PAY Malang)<br />10. Rita (Owner Succes Travel)<br /><br />Pendaftaran berlangsung tanggal 6-11 Juli 2013</p>', '2013/07/09/20130709_232133_4517.jpg', 'Festival Sukses Mulia 2013', 'Gedung Widyaloka Universitas Brawijaya', '2013-07-14 00:00:00', '', '2013-07-09 00:00:00'),
(11, 1, 'Swap Meet Diecast Toys Malang', 'swap-meet-diecast-toys-malang', '<p><span>Swap Meet Diecast Toys Malang pada bulan Juli 2013 kali ini bakal digelar pada:</span><br /><br /><strong>Hari:</strong><span>&nbsp;Minggu</span><br /><strong>Tanggal:</strong><span>&nbsp;7 Juli 2013</span><br /><strong>Pukul:</strong><span>&nbsp;11.00 am</span><br /><strong>Tempat:</strong><span>&nbsp;</span><a href="http://halomalang.com/peta-malang/detail/monopoli-park-view-cafe-and-resto">Monopoli Cafe</a><br /><br /><span>Ngalamers bisa membawa diecast-diecast kesayangan, baik untuk show off, barter, atau untuk dijual dalam kegiatan ini.</span><br /><br /><span>"</span><em>Never too old for diecast!</em><span>" :)</span><br /><br /><span>Nb: buat member yang udah punya seragam DTM, harap mengenakan seragam saat hadir.</span></p>', '2013/07/09/20130709_232349_4569.jpg', 'Swap Meet Diecast Toys Malang', 'Monopoli Cafe', '2013-07-15 00:00:00', '', '2013-07-09 00:00:00'),
(12, 1, 'Share The Joy of Ramadhan With FFI Malang', 'share-the-joy-of-ramadhan-with-ffi-malang', '<p>Donasi dapat berupa:</p>\n<ul>\n<li>Baju (bekas atau baru)</li>\n<li>Buku bacaan anak-anak</li>\n<li>Uang tunai</li>\n<li>Sembako</li>\n</ul>\n<p>On the spot:</p>\n<ul>\n<li>Car free day, Jl. Ijen Malang</li>\n<li>Perpustakaan Universitas Brawijaya</li>\n</ul>\n<p>Transfer:</p>\n<ul>\n<li>BRI an. Dita Fadilla Kurniawati 3128-01-019540-53-7</li>\n<li>Mandiri an. Dita Fadilla Kurniawati 900-00-1591811-4</li>\n</ul>\n<p>Penerimaan donasi dimulai tanggal 1 - 19 Juli 2013 dan akan disumbangkan ke Panti Asuhan Darussalam Singosari tanggal 20 Juli 2013<br /><br />Contact person:<br />Ran 08990409580</p>', '2013/07/09/20130709_232439_9817.jpg', 'Share The Joy of Ramadhan With FFI Malang', 'Perpustakaan Universitas Brawijaya', '2013-07-16 00:00:00', '', '2013-07-09 00:00:00'),
