INSERT INTO `news` (`id`, `nama`, `content`) VALUES
(1, 'Pelamar', '<p>&nbsp;</p>\n<p><span style="color: #ff6600;"><strong><span style="font-size: medium;">Selamat Datang calon parapekerja..</span></strong></span><br /><br />Perkenalkan nama saya Titis Lestari, tugas saya adalah untuk membantu member parapekerja bisa mendapatkan pekerjaan yang sesuai anda inginkan..<br /><br />untuk memulai kesiapan anda dalam mencari kerja, dimulai dengan tahapan anda melengkapi Resume anda dengan baik dibawah ini..</p>\n<p><br />tahap kedua adalah jika anda memiliki alamat email tujuan anda untuk melamar pekerjaan, silahkan gunakan menu <strong>Kirim Lamaran</strong>..<br /><br />anda bisa membuat cover letter untuk surat lamaran anda di menu <strong>Surat Lamaran</strong><br /><br />Salam parapekerja</p>\n<p>Titis Lestari</p>'),
(2, 'Perusahaan', '<p>Pengumuman untuk Para Perusahaan</p>');
