(5, 67, 1, '<p class="_mce_tagged_br"><span style="font-size: small;">&nbsp;PENDIDIKAN NON FORMAL</span></p>\n<p><span style="font-size: small;">1. Pelatihan Operator Alat Berat Di Badan Rehabilitasi Dan Rekontruksi <strong>(BRR) </strong>NAD&ndash;Nias &nbsp;&nbsp;&nbsp;&nbsp;<strong>(Sertifikat)</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\n<p><span style="font-size: small;"><strong>8 &ndash; 23September 2006</strong></span></p>\n<h2><span style="font-size: small;">2. Pelatihan Kepemimpinan dan Penguatan Kapasitas Sosial Karang Taruna Se-Kota Lhokseumawe (Sertifikat)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></h2>\n<h2><span style="font-size: small;">10 &ndash; 11 September 2007</span></h2>\n<h2><span style="font-size: small;">3. Bimbingan Teknis Pengelolaan Perpustakaan Desa/Kelurahan Kabupaten/Kota Se-Provinsi Nanggroe Aceh Darussalam &nbsp;( Lampineung &ndash; Banda Aceh ) &nbsp;(Sertifikat) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</span></h2>\n<h2><span style="font-size: small;">20 &ndash; 22 Oktober 2008</span></h2>\n<p><span style="font-size: small;">4. Pelatihan Asisten Fasilitator Kecamatan Program Nasional Pemberdayaan Masyarakat (PNPM) Mandiri Perdesaan dan BKPG pada BPM Provinsi NAD <strong>&nbsp;</strong><strong>(Sertifikat)</strong> <strong>2009</strong></span></p>\n<p><span style="font-size: small;">5. Peace Building Training&nbsp; Conflict Resolution and Mediation Training For Community Development Facilitators<strong>(Sertifikat)</strong>&nbsp;&nbsp; Conducted in Bireun :</span></p>\n<p><span style="font-size: small;"><strong>October 28 &ndash; 30, 2009</strong></span></p>\n<p><span style="font-size: small;">6. Pelatihan Usaha Ekonomi Produktif Gampong ( UEPG ) Oleh Badan Pemberdayaan Masyarakat &nbsp;&nbsp;&nbsp;( BPM ) Provinsi Aceh Tahun 2011 di Banda Aceh <strong>(Sertifikat)</strong>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p><span style="font-size: small;"><strong>10 &ndash; 12 Agustus 2011</strong></span></p>'),
