(25, 389, 1, '<p><strong>PENDIDIKAN NON FORMAL</strong></p>\n<p>&uuml;&nbsp; 2008 : Kunjungan Ke Bursa Efek Indonesia &ldquo;<strong><em>RESHAPE YOUR PERPECTIVE</em></strong>&rdquo; Introduction to Indonesia Stock Exchange.</p>\n<p>&uuml;&nbsp; 2009 : Peserta Seminar/Pelatihan Bedah buku &ldquo;<strong>Strategi Kebangkitan Ekonomi Indonesia</strong>&rdquo; di Kampus STIE EKUITAS, Bandung.</p>\n<p>&uuml;&nbsp; 2009 : Kursus &ldquo;<strong><em>TOEIC Preparation</em></strong>&rdquo; di Kampus STIE EKUITAS, Bandung</p>\n<p>&uuml;&nbsp; 2011 : Diklat &ldquo;<strong>Operasional Perbankan Syariah&rdquo; </strong>diselenggarakan oleh Pelita Pratama Training Centre, Bandung</p>\n<p>&uuml;&nbsp; 2011 : Pelatihan/Kursus <strong>&ldquo;Komputer Perkantoran&rdquo;&nbsp;</strong>di LPK PIKSI Megatama, Bandung</p>\n<p>&uuml;&nbsp; 2011 : Pelatihan/Kursus Pengenalan Standart ISO 9001:2008 di PT Multibratha Anugerah Utama, Bandung</p>'),
