(7, 34, 3, '<p>TELEMARKETING DI SALAH SATU PERUSAHAAN INTERNASIONAL</p>\n<p>TEKNIK INSTRUMENTASI DI PT PUPUK KALIMANTAN TIMUR</p>\n<p>ENVIRONMENT DI PTKMR-BATAN</p>\n<p>CV USAHA MANDIRI SEBAGAI OPERATOR MESIN DAN KOMPUTER</p>'),
(8, 36, 3, '<ul>\n<li><strong>Ministry of Justice and Human Rights Republic of Indonesia, 1st class Immigration Pontianak Office.</strong></li>\n</ul>\n<p><strong><em>Executive staff of information and immigration data&nbsp; :</em></strong></p>\n<p><strong>&nbsp;</strong></p>\n<ol>\n<li>Preparation of travel documents, visas and facilities, and residence &nbsp;</li>\n</ol>\n<p>status, intelligence investigation and prosecution, cross border and international cooperation and information system on immigration.</p>\n<ol>\n<li>Implementation in the field of travel document, visas and facilities, and</li>\n</ol>\n<p>residence status, intelligence investigation and prosecution, cross border and international cooperation and information system in accordance with the provisions of immigration legislation.</p>\n<p>3. &nbsp;&nbsp;Electronic Office Supervisor ;</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.a. Responsible for traffic foreigners (WNA).</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.b. Collecting and reporting data visa for foreigners (WNA).</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.c. Foreigner (WNA) on line system data.</p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.d. Stay Permit (ITKA residence permit requests).</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.e. ITAS (a limited residency permit).</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.f. ITAP (Permanent residency permit).</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.g. Preparing AFIDAPIT.</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.h. Extension of residence permit.</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.i. Return (EPO).</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.j. Control of blaming immigration permits for foreigners (WNA).</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.k. Actions Immigration (Deportation).</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.l. Immigration Diplomatic License.</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.m. Collecting data from airports, ports.</p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Apr / 2006 - Apr / 2010</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li><strong>PT.Nahla Subulana</strong></li>\n</ul>\n<p><strong><em>Finance Manager</em></strong><strong><em> :</em></strong></p>\n<p><strong><em>&nbsp;</em></strong></p>\n<ol>\n<li>providing and interpreting financial information;</li>\n<li>monitoring and interpreting cash flows and predicting future trends;</li>\n<li>analysing change and advising accordingly;</li>\n<li>formulating strategic and long-term business plans;</li>\n<li>researching and reporting on factors influencing business performance;</li>\n<li>analysing competitors and market trends;</li>\n<li>developing financial management mechanisms that minimise financial risk;</li>\n<li>conducting reviews and evaluations for cost-reduction opportunities;</li>\n<li>managing a company''s financial accounting, monitoring and reporting systems;</li>\n<li>liaising with auditors to ensure annual monitoring is carried out;</li>\n<li>developing external relationships with appropriate contacts, e.g. auditors, solicitors, bankers and statutory organisations such as the Inland Revenue;</li>\n<li>producing accurate financial reports to specific deadlines;</li>\n<li>managing budgets;</li>\n<li>arranging new sources of finance for a company''s debt facilities;</li>\n<li>supervising staff;</li>\n<li>keeping abreast of changes in financial regulations and legislation.</li>\n</ol>\n<p>&nbsp;</p>\n<p><strong>Oct</strong><strong> / 20</strong><strong>11</strong><strong>&ndash; Present.</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li><strong>Universitas Kejuangan 45</strong></li>\n</ul>\n<p><strong><em>Lecturer:</em></strong></p>\n<p><strong><em>&nbsp;</em></strong></p>\n<p>1. giving lecture ;</p>\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.a. Costs accounting.</p>\n<p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.b. Management accounting.</p>\n<p>2. Make analyses and give tests</p>\n<p>3.Direct weekly and montly report to coordinator.</p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>Jan / 2009 &ndash; Present</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>&nbsp;</strong></p>'),
