(13, 67, 3, '<p><strong>Program Nasional Pemberdayaan Masyarakat Mandiri Perdesaaan (PNPM MPd )-BKPG</strong></p>\n<p><strong>Posisi : Asisten Fasilitator Kecamatan ( AFK )</strong></p>\n<p>Tugas Dan Tanggung Jawab :</p>\n<ul>\n<li>Melakukan pemantapan terhadap pelaksanaan kegiatan PNPM Mandiri Perdesaan di desa sesuai dengan pengaturan tugas dari Fasilitator Kecamatan.</li>\n<li>Membantu Fasilitator Kecamatan dalam melaksanakan pemeriksaan kegiatan di lapangan.</li>\n<li>Membantu Fasilitator Kecamatan dalam melakukan bimbingan pada KPMD mengenai kegiatan pemberdayaan, transparansi dan manajemen.</li>\n<li>Membantu Fasilitator Kecamatan dalam melaksanakan pelatihan kepada TPK dan masyarakat.</li>\n<li>Memberikan bimbingan dan masukan atau saran teknis maupun non teknis kepada Tim Pengelola Kegiatan.</li>\n<li>Membuat gambar kerja&nbsp; sesuai petunjuk FT-Kec dan membantu dalam pembuatan gambar desain dan gambar purna laksana.</li>\n<li>Membimbing dan memberi penjelasan kepada masyarakat mengenai cara-cara menjaga kelestarian lingkungan.</li>\n<li>Memberikan bimbingan dan masukan tentang cara-cara administrasi, pembukuan serta pengarsipan Tim Pengelola Kegiatan.</li>\n<li>Membantu dan membimbing Tim Pengelola Kegiatan dalam penyiapan serta proses pra audit.</li>\n<li>Mengumpulkan informasi tentang aspek non teknis antara lain : partisipasi, memeriksa keluhan masyarakat untuk disampaikan kepada Fasilitator Kecamatan.</li>\n<li>Membimbing KPMD dalam menginventarisasi kebutuhan masyarakat dalam kaitannya dengan rencana jangka panjang masyarakat.</li>\n<li>Memfasilitasi proses pemeliharaan hasil kegiatan, pengembangan dan pelestariannya, serta pengembalian pinjaman&nbsp; dana bergulir.</li>\n</ul>\n<p align="right"><strong>01 April 2009 &nbsp;&ndash;&nbsp; </strong><strong>31 Desember 2012</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>Program Nasional Pemberdayaan Masyarakat Mandiri Perdesaaan (PNPM MP )</strong></p>\n<p><strong>Posisi : Kader Pemberdayaan Masyarakat Desa ( KPMD )</strong></p>\n<p>&nbsp;Tugas Dan Tanggung Jawab :</p>\n<ul>\n<li>Memfasilitasi pelaksanaan pendataan RTM dan penyusunan peta sosial pada saat musyawarah dusun,</li>\n<li>Mengumpulkan data-data yang diperlukan untuk proses penggalian gagasan, seperti : data kelompok masyarakat yang ada di desa, data penduduk miskin, hasil pendataan RTM dan data pendukung lainnya,</li>\n<li>Menyebarluaskan dan mensosialisasikan PNPM Mandiri Perdesaan kepada masyarakat desa.</li>\n<li>Memastikan terlaksananya tahap-tahap kegiatan PNPM Mandiri Perdesaan di desa mulai dari perencanaan, pelaksanaan&nbsp; sampai pelestarian.</li>\n<li>Mendorong dan memastikan penerapan prinsip-prinsip dan kebijakan PNPM Mandiri Perdesaan setiap&nbsp;&nbsp; tahapan PNPM Mandiri Perdesaan di desa, mulai dari perencanaan, pelaksanaan sampai&nbsp; pelestarian.</li>\n<li>Mengikuti pertemuan bulanan dengan PL yang difasilitasi oleh Fasilitator Kecamatan untuk membahas kendala dan permasalahan yang muncul serta mengambil langkah-langkah yang diperlukan.</li>\n<li>Membantu dan memfasilitasi proses penyelesaian masalah perselisihan di desa.</li>\n<li>Mengefektifkan penggunaan papan informasi di desa dan dusun</li>\n<li>Mendorong&nbsp; masyarakat&nbsp; untuk&nbsp; berperan&nbsp; serta&nbsp; dalam pelaksanaan kegiatan, termasuk dalam pengawasan.</li>\n</ul>\n<p align="right"><strong>27 Juni 2008&nbsp; &ndash;&nbsp; 31 Januari 2009</strong></p>\n<p>&nbsp;</p>\n<p><strong>CV.ORIENSTAR GEUDONG</strong></p>\n<p><strong>Posisi : Sales Promotion</strong></p>\n<p>Tugas Dan Tanggung Jawab :</p>\n<ul>\n<li>Mencari Pasar ( Pelanggan Baru ) Untuk Meningkatkan Penjualan Perusahaan</li>\n<li>Melayani Pesanan Produk</li>\n<li>Koordinasi Langsung dengan Pelanggan tentang Design dan Jumlah Produk yang dipesan</li>\n<li>Membuat Laporan Bulanan</li>\n</ul>\n<p align="right"><strong>13 Desember 2000&nbsp; &ndash;&nbsp; 30 September 2005</strong></p>'),
