(51, 529, 3, '<p>2013 &ndash; now Process Engineering Power Plant at&nbsp; PT. Bumi Laksamana Jaya Group and PT. Zug&nbsp; Industry Indonesia</p>\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Analysis of process water</p>\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Power plant process control</p>\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Control cooling tower</p>\n<p>&nbsp;</p>\n<p>2012-2013 Process Engineering and Control Peat Water Treatment at PT. Riau Sakti United Plantation Industri (PT.RSUP)</p>\n<p>- Control of the injection process chemical solutions<br /> - Control of pipes, pumps and tools supporting the entire process<br /> - Ensure chlorine levels of 1 to 2.8% in the yield of water<br /> - Make sure the water in accordance with the specification of the production process &nbsp;milk<br /> - Make sure all the equipment worked perfectly<br /> - Ensure water flow to all parts of plant, processes, housing <br /> - Making efficient use of chlorine from chlorine content 60% to chlorine TCCA until 70 %<br /> - Efficiency of water use washing and rinsing sand filter, carbon filter as much as 350 m<sup>3 </sup>/ day.<br /> - Design effective flocculation basin peat 100,000 tonnes of raw water / day into clean water.</p>\n<p>- Proses control cooling tower (alga, scale and bacteri)</p>\n<p><strong>Training At PT. RSUP Industry:</strong></p>\n<p>OHSAS 18001, ISO 14001, SMK 3, ISO 22000-1, HACCP, GMP, and 5 S</p>\n<p>2010 - 2012 CV. PUTRA PRIBUMI as a coal sales agent</p>\n<p>- Looking for buyers<br /> - Contacts, meetings, purchase, delivery control</p>\n<p>2011 Internship at PT. Cement Batu Raja, Performance Evaluation of Kiln ( A Certification)</p>\n<p>2010 - 2012 Hair Vacuum Equipment Design (Research)</p>\n<p>2010 - 2011 Lobby Procurement Heavy Equipment and Dump Truck for CV.Flamboyan</p>\n<p>- Search order request<br /> - Contact the supplier<br /> - Check the condition of the vehicle (legal, method of payment)<br