(73, 887, 3, '<p>1. Mengawasi tukang spesialis waterproofing</p>\n<p>2. Mengecek kualitas pekerjaan</p>\n<p>3. Menghitung dan mengopname pekerjaan yang telah selesai dikerjakan</p>\n<p>4. Koordinasi dengan pihak-pihak terkait (seperti owner, konsultan, dan kontraktor)</p>\n<p>5. Mengatur tenaga kerja di lapangan agar bekerja sesuai dengan schedule atau rencana yang ditetapkan.</p>\n<p>6. Mengontrol keuangan mingguan proyek</p>'),
(74, 897, 3, '<p>CMM</p>\n<p>-&nbsp;&nbsp; &nbsp;Treatment Machine<br />-&nbsp;&nbsp; &nbsp;Smooth Production</p>\n<p>&nbsp;</p>\n<p>HPI</p>\n<p>-&nbsp;&nbsp; &nbsp;Determine the machine<br />-&nbsp;&nbsp; &nbsp;Determine loading machine<br />-&nbsp;&nbsp; &nbsp;Create a sheet processing<br />-&nbsp;&nbsp; &nbsp;Determining the purchase of materials</p>'),
(75, 919, 1, 'Saya baru lulus dan sedang mencari pekerjaan pertama saya');
