(20, 1, 'Surat Lamaran HTML', '<p>Saya coba <strong>tebal</strong> <em>italic</em> <span style="text-decoration: underline;">underline</span></p>'),
(11, 1, 'Surat Lamaran 1', '<p>Isi Surat Lamaran 1</p>'),
(15, 1, '4', '<p>4</p>'),
(16, 1, '5', '<p>5</p>'),
(21, 10, 'surat lamaran PT Arahan Mandiri', '<p>dasdasdasdasdas</p>'),
(22, 10, 'PT Telkom Indonesia', '<p>hai idasdnasdaskldaskldjklasdjasldasdas sdadasdas</p>'),
(27, 72, 'Lamaran Kerja', '<p>&nbsp;</p>\n<p>Perihal&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Permohonan Lamaran Kerja</p>\n<p>Lampiran&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 1 (satu) Berkas</p>\n<p>&nbsp;</p>\n<p>Kepada</p>\n<p>Yth. HRD Personalia</p>\n<p>Di&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp; Tempat</p>\n<p>&nbsp;</p>\n<p>Dengan Hormat,</p>\n<p>Dengan ini saya mengajukan lamaran pekerjaan yang Bapak/Ibu pimpin. Adapun data pribadi saya sebagai berikut :</p>\n<p>Nama &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Eka Wardana S</p>\n<p>Tempat/Tgl. Lahir &nbsp; &nbsp;: Tasikmalaya, 09 Maret 1987</p>\n<p>Pendidikan &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : S1 TEKNIK INFORMATIKA, FAKULTAS ILMU KOMPUTER</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;UNIVERSITAS KUNINGAN</p>\n<p>Alamat &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Kampung Jati Asih Warung Kobak Rt.002 Rw.001</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Desa Pasir Gombong Kec. Cikarang Utara - Bekasi 17530</p>\n<p>Telepon &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : 085295725541/ 081324550085</p>\n<p>Demikian lamaran ini saya sampaikan. semoga Bapak/Ibu berkenan mempertimbangkan aplikasi dan kualifikasi Saya. Atas perhatian Bapak/Ibu saya ucapkan terima kasih.</p>\n<p>&nbsp; &nbsp; &nbsp;</p>\n<p>Hormat Saya,</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>Eka Wardana.S</strong></p>\n<p>&nbsp;</p>'),
(24, 10, 'Cover Leter umum', '<div>Jakarta, 26 Maret 2013</div>\n<div>&nbsp;</div>\n<div>Kepada Yth.</div>\n<div>HRD Manager<br /> PT. Bersaudara, Tbk.<br />Jl. Penjernihan Raya No. 2</div>\n<div>Pejompongan</div>\n<div>Jakarta Pusat</div>\n<div>&nbsp;</div>\n<div>Dengan hormat,</div>\n<div>&nbsp;</div>\n<div>Saya yang bertandatangan dibawah ini :</div>\n<div>&nbsp;</div>\n<table border="0" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="163">\n<div>Nama&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</div>\n</td>\n<td valign="top" width="300">\n<div>: Agus Darwanto, SE</div>\n</td>\n</tr>\n<tr>\n<td valign="top" width="163">\n<div>Tempat, Tanggal Lahir&nbsp;</div>\n</td>\n<td valign="top" width="300">\n<div>: Jakarta, 8 Mei 1980</div>\n</td>\n</tr>\n<tr>\n<td valign="top" width="163">\n<div>Alamat&nbsp;&nbsp;</div>\n</td>\n<td valign="top" width="300">\n<div>: Petamburan RT. 02/09, Tn. Abang, Jakarta</div>\n</td>\n</tr>\n<tr>\n<td valign="top" width="163">\n<div>No. Telp/HP</div>\n</td>\n<td valign="top" width="300">\n<div>: 0812 987654321</div>\n</td>\n</tr>\n<tr>\n<td valign="top" width="163">\n<div>Pendidikan terakhir</div>\n</td>\n<td valign="top" width="300">\n<div>: S1 Akuntansi</div>\n</td>\n</tr>\n</tbody>\n</table>\n<div>&nbsp;</div>\n<div>Dengan ini mengajukan surat permohonan untuk bekerja di perusahaan Bapak/Ibu sebagai Accounting Manager.</div>\n<div>&nbsp;</div>\n<div>Saat ini saya memiliki pendidikan Strata 1 yang memiliki korelasi dengan pekerjaan terkait, dan memiliki sedikit pengalaman sebagai Accounting Manager di salah satu Perusahaan terkemuka di Jakarta.</div>\n<div>&nbsp;</div>\n<div>Dengan surat permohohan ini, saya menyatakan siap untuk memberikan waktu dan tenaga apabila di perlukan dan besar harapan saya untuk dapat mengikuti tes seleksi dan wawancara.</div>\n<div>&nbsp;</div>\n<div>Demikian, atas perhatian dan kerjasamanya diucapkan terima kasih.</div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div>Hormat Saya</div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div>Agus Darwanto, SE</div>\n<div>&nbsp;</div>\n<div>Lampiran Surat :</div>\n<div>Daftar riwayat hidup</div>\n<div>Fotocopy KTP (ID Card)</div>\n<div>Fotocopy ijazah terakhir</div>'),
(28, 201, 'Surat Lamaran', '<p><strong>Kepada Yth,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\n<p><strong>Manager Personalia</strong></p>\n<p><strong>Di -</strong></p>\n<p><strong>Tempat </strong></p>\n<p>Perihal: <strong><span style="text-decoration: underline;">Lamaran pekerjaan</span></strong></p>\n<p>Dengan hormat,</p>\n<p>Saya yang bertanda tangan di bawah ini :</p>\n<ol>\n<li>Nama&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Jeri. Sy</li>\n<li>TTl&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Bukittinggi, 01 Januari 1986</li>\n<li>Alamat &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Jl. KH. Dewantoro Gg. Nurul Huda I Rt/Rw 002/015, Ciputat</li>\n</ol>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Kec. Ciputat, Tangerang Selatan</p>\n<p>&nbsp; &nbsp; &nbsp; 4. No. Hp &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 085218157806</p>\n<p>Bersama ini saya mengajukan, surat permohonan lamaran pekerjaan untuk menjadi salah satu karyawan di perusahaan yang sedang Bapak\\Ibu pimpin.</p>\n<p>Demikianlah surat lamaran pekerjaan ini saya ajukan kepada Bapak/Ibu pimpinan personalia, agar kiranya Bapak\\Ibu dapat mempertimbangkan serta mengabulkannya.</p>\n<p>Atas perhatian dan kebijaksaan Bapak\\Ibu saya mengucapkan terimakasih.</p>\n<p>&nbsp;</p>\n<p>Hormat saya,</p>\n<p>&nbsp;</p>\n<p><strong>(Jeri. Sy)</strong></p>'),
(29, 215, 'The Power of Me', '<p>Dear Sir / Madam,</p>\n<p><strong><span style="text-decoration: underline;">&nbsp;</span></strong></p>\n<p>Have been informed that there is a vacancy in your office, I conveyed this application letter.</p>\n<p>I&rsquo;m 23 years old, and have graduated from Law Faculty of Padjadjaran University; I have done professional developments such as courses and seminars dealing with legal matters.</p>\n<p>For additional information, I have strong objective to achieve legal work field. I have good academic ability and sound leadership and people/human relations skills. I work well and comfortable to work with people from various levels. I have ability to perform as part of a team as well as individual can deal competently with either administrative duties or field duties. I&rsquo;m familiar with computer applications, such as Microsoft Office (including MS Word, MS Excel, and MS Power Point). I am fluent in Indonesian and English, both oral and written. Currently, I am seeking a professional exposure in an excellent organization which will enable me to contribute and develop my legal knowledge and experience. I really hope that you would give me a chance to prove my capabilities and to do all that I could to learn from you and contribute to that success in the future. The attached CV will provide you with more details of my background.</p>\n<p>I would be very happy to have the opportunity to meet you to discuss how my background and qualifications could be use to your office. Please feel free to contact me by phone or at the address set forth. Thank you in advance for taking the time to review my resume.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sincerely</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yudha Bestari</p>'),
(30, 244, 'Surat Lamaran', '<p align="right">Jambi , 31 Agustus 2013</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Kepada YTH</p>\n<p>Telkom Landmark Tower</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Dengan hormat,</p>\n<p>Berdasarka informasi yang saya dapatkan dari Indonesia karir</p>\n<p>&nbsp;</p>\n<p>Saya yang bertanda tangan dibawah ini:</p>\n<p>&nbsp;</p>\n<p>Nama&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : ADE IRAWAN</p>\n<p>Tempat, Tanggal Lahir&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Pasar Singkut, 16 Februari 1990</p>\n<p>Alamat&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Ds. Pasar Singkut Blok Cianjur RT/ 24 RW/ 09,</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kec. Singkut, Kab. Sarolangun, Prov. Jambi.</p>\n<p>No. Hp&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 087838311742</p>\n<p>Pendidikan terakhir&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : S1 Manajemen</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Dengan ini bermaksud mengajukan surat permohonan untuk bekerja di perusahaan bapak/ ibu sebagai <em>Legal Officer.</em></p>\n<p>Dengan surat permohonan ini, saya nyatakan siap untuk memberikan waktu dan tenaga apabila diperlukan dan besar harapan saya untuk mengikuti tes seleksi dan wawancara.</p>\n<p>Terimakasih</p>\n<p>&nbsp;</p>\n<p align="right">Hormat saya,</p>\n<p align="right">&nbsp;</p>\n<p align="right">&nbsp;</p>\n<p align="right">Ade Irawan</p>'),
(33, 317, 'Permohonan Kerja', '<p>Kepada Yth,<br /> HRD<br /> di</p>\n<p>Tempat</p>\n<p>Perihal : Lamaran Pekerjaan</p>\n<p><br /> Dengan hormat,<br /> <br /> Bersama ini saya sampaikan keinginan saya untuk melamar pekerjaan.</p>\n<p><br /> Pendidikan terakhir saya di S1 ITATS diselesaikan pada tahun 2001. Saya lulusan Jurusan Teknik Informatika Program Studi&nbsp; Teknik Informatika<br /> <br /> Besar harapan saya, agar bapak/ibu bersedia meluangkan waktu untuk wawancara, sehingga saya dapat memperkenalkan diri secara lebih baik dan terperinci.<br /> <br /> Atas perhatian bapak/ibu, saya ucapkan terima kasih.<br /> <br /> Hormat saya,</p>\n<p>&nbsp;</p>\n<p><br /> <br /> Rahmad Gunardi, ST</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>'),
(34, 854, 'Surat Lamaran Choirunnisa', '<p>Jakarta, &nbsp;Oktober 2013</p>\n<p>&nbsp;</p>\n<p>Yth,</p>\n<p>Bapak/Ibu Kepala Personalia</p>\n<p>Di tempat</p>\n<p>&nbsp;</p>\n<p>Dengan hormat,</p>\n<p>&nbsp;</p>\n<p>Saya adalah mahasiswa jurusan psikologi pendidikan di Universitas Negeri Jakarta, yang telah lulus dan telah menerima gelar sarjana pada 24 September 2011. Melalui surat ini saya sampaikan keinginan saya untuk bergabung menjadi karyawan pada perusahaan yang Bapak/Ibu pimpin. Saya memiliki pengalaman kerja yang berhubungan dengan bidang personalia, marketing, dan admin serta pengalaman organisasi dalam bidang kesekretariatan.</p>\n<p>&nbsp;</p>\n<p>Saat ini saya dalam kondisi kesehatan yang baik, dan dapat bekerja dalam tim maupun individu dengan baik, walaupun untuk pekerjaan dengan tenggat waktu (<em>dead line</em>). Berdasarkan pengalaman kerja yang saya miliki serta adanya kemauan belajar dan bekerja dengan lebih baik lagi, saya berkeyakinan akan dapat memberikan kontribusi&nbsp; yang berharga untuk perusahaan yang Bapak/Ibu pimpin</p>\n<p>&nbsp;</p>\n<p>Berikut data pribadi saya:</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; nama&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Choirunnisa</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; tempat, tanggal lahir&nbsp;&nbsp; : Jakarta, 25 Februari 1988</p>\n<p>alamat&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Jl. I Gusti Ngurahrai Kp Buaran I Rt 08/RW 12 No 43</p>\n<p>&nbsp; Klender&nbsp;&nbsp; &ndash; Jakarta Timur 13470</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; Telp : 021-94971316 / 0856-97091988</p>\n<p>pendidikan &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : S1 Psikologi Pendidikan, Fakultas Ilmu Pendidikan</p>\n<p>&nbsp; Universitas Negeri Jakarta</p>\n<p>&nbsp;</p>\n<p>Sebagai bahan pertimbangan, saya lampirkan beberapa data pendukung sebagai berikut:</p>\n<ol start="1">\n<li>Daftar Riwayat Hidup</li>\n<li>Foto Copy Transkrip Nilai</li>\n<li>Foto Copy KTP</li>\n<li>Pas Photo</li>\n</ol>\n<p>&nbsp;</p>\n<p>Saya berharap Bapak/Ibu bersedia meluangkan waktu untuk wawancara sehingga saya dapat memperkenalkan diri saya secara lebih rinci. Semoga kualifikasi dan pengalaman kerja saya sesuai dengan kebutuhan karyawan di perusahaan yang Bapak/Ibu pimpin. Selanjutnya Saya menunggu konfirmasi di alamat dan/atau telp. Saya di atas. Atas perhatian Bapak/Ibu saya ucapkan terima kasih.</p>\n<p>&nbsp;</p>\n<p>Hormat Saya</p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;</p>\n<p><strong>Choirunnisa</strong></p>');
