(10, 75, 2, 'tes lowongan kerja pt arahan mandiri', '', 'Driver', 4, '', '', '', '<h2>Requirements</h2>\n<p>&nbsp;</p>\n<div id="jobreq-text">\n<ul>\n<li>Candidates must possess at least a Bachelor&rsquo;s Degree in Environmental Health and Safety or any relevant field.</li>\n<li>At least 2 years of working experiences in the related field is required for this position.</li>\n<li>Application should be Malaysian citizens or hold relevant residence status.</li>\n<li>Willing to work long hours.</li>\n<li>High degree of integrity, maturity, professionalism and loyalty.</li>\n<li>Strong leadership qualities and good interpersonal skills.</li>\n<li>Demonstrates commitment to working as part of the team.</li>\n<li>Generate ideas and solutions with some creativity and laterality of thought.</li>\n<li>Demonstrates a broader understanding of the business beyond a single function.</li>\n<li>Works to build or maintain friendly reciprocal and warm relationships or network of contacts with people who are or might someday be useful in achieving work related goals.</li>\n<li>Knowledge and understanding of ISO 9001:2000 requirements.</li>\n</ul>\n</div>', '', '', '', 1592, '3', 2, 4, 200000, '2014-03-28', '2014-03-31', 'ridwanamirsene@yahoo.com', 'ridwanamirsene@yahoo.com', '', 8, 0, 0),
