(22, 75, 2, 'tes lowongan kerja pt arahan mandiri', '', 'Driver', 4, '', '', '', '<h2>Requirements</h2>\n<p>&nbsp;</p>\n<div id="jobreq-text">\n<ul>\n<li>Candidates must possess at least a Bachelor&rsquo;s Degree in Environmental Health and Safety or any relevant field.</li>\n<li>At least 2 years of working experiences in the related field is required for this position.</li>\n<li>Application should be Malaysian citizens or hold relevant residence status.</li>\n<li>Willing to work long hours.</li>\n<li>High degree of integrity, maturity, professionalism and loyalty.</li>\n<li>Strong leadership qualities and good interpersonal skills.</li>\n<li>Demonstrates commitment to working as part of the team.</li>\n<li>Generate ideas and solutions with some creativity and laterality of thought.</li>\n<li>Demonstrates a broader understanding of the business beyond a single function.</li>\n<li>Works to build or maintain friendly reciprocal and warm relationships or network of contacts with people who are or might someday be useful in achieving work related goals.</li>\n<li>Knowledge and understanding of ISO 9001:2000 requirements.</li>\n</ul>\n</div>', '', '', '', 1592, '3', 2, 4, 200000, '2014-03-28', '2014-03-31', 'ridwanamirsene@yahoo.com', 'ridwanamirsene@yahoo.com', '', 4, 0, 0),
(63, 82, 64, 'Analyst (Investment Bank / Strategic Consulting)', '#analist', '', 3, '', '', '', '', '<p><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;"><strong>Requirements:</strong></span></p>\n<ul>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Bachelor or Master degree from reputable national/international university majoring in finance/accounting/business (graduates majoring in other fields with articulated interests and knowledge in finance are welcome to apply)</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Working experience in relevant field for 1-3 years (fresh graduates are welcome to apply)</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Fluent in English (written and spoken)</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Strong computer skills with significant experience with Word, Excel and Powerpoint</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Possess strong quantitative, analytical, research, and reporting/writing skills</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Self-motivated, independent, success driven, excellent communication and interpersonal skills</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Fast and eager learner with excellent attention to detail, time management and multitasking skills</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Responsible, energetic, discipline, team player, and able to work under pressure to strict deadlines</span></li>\n</ul>\n<p><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;"><strong>Responsibilities:</strong></span></p>\n<ul>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Develop familiarity with industry, and related companies</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Assist in development of deliverables including analysis of industry, financial, strategic, operational assessment, valuation and financial models</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Perform gathering and preparation of industry and company research and assistance with developing client memoranda</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Maintain computer databases covering industry and related companies</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Track corporate finance including M&amp;A and financing activities, structure, growth and trends for industries of interest</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Assist teams with identifying potential strategic and financial suitors</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Participate in prospect pitch preparation and presentation as well as company visits, pre-engagement and project execution due diligence</span></li>\n<li><span style="font-size: 10pt; font-family: verdana,arial,helvetica,sans-serif;">Perform other duties and responsibilities as assigned</span></li>\n</ul>', '', '', 1335, '7,4,8', 3, 3, 100000, '2013-08-20', '2013-08-22', 'ridwanamirsene@yahoo.com', 'ridwanamirsene@yahoo.com', '', 54, 2, 1),
(65, 133, 19, 'Lowongan Administrasi', '', '', 3, '', '', 'Kata Undangan', '', '<p>We are leading interlining distributor in East Java established in April 2011 and officially start operation on July 2011. We are looking for qualified Indonesian candidate to fill in following Vacant Position:</p>\n<p>ADMINISTRATION</p>\n<p>Requirements: </p>\n<ul>\n<li>Male /Female</li>\n<li>S1/D3 Degree majoring in Accounting/Administration, GPA 2.75</li>\n<li>Experienced 1 &ndash; 2 years in Accounting/Administration is an advantage</li>\n<li>Having good knowledge of tax is an advantage</li>\n<li>Fresh Graduates are welcome to apply </li>\n<li>Have experienced in Foreign Investment Company is an advantage</li>\n<li>Basic computer skills (Microsoft Office, Email, Internet)</li>\n<li>Good command in English, both written and spoken</li>\n<li>Having good attitude, passionate &amp; good health</li>\n</ul>', '', '', 1592, '3', 3, 2, 0, '2013-10-16', '2013-10-31', 'mail@mail.com', 'mail@mail.com', '', 2, 0, 1),
(66, 133, 6, 'Lowongan Kerja', '', '', 3, '', '', 'Kata Undangan\n', '', '<p>Perusahaan BUMN yang bergerak di bidang manufacturing Pressure Vessel, Heat Exchanger, Condenser, Piping, Structure membutuhan segera formasi tenaga untuk :</p>\n<p>A. Penempatan Wilayah Pasuruan <br />Fabrication Engineer (FE) : 2 orang <br />QC Engineer (QE) : 1 orang <br />Welding Engineer (WE) : 1 orang <br />Sales &amp; Proposal Engineer (SE) : 1 orang <br />Environmental Engineer (EE) : 1 orang <br />Buyer Engineer (BE) : 1 orang <br />Administrasi Pengadaan (AP) : 1 orang</p>\n<p>Persyaratan : </p>\n<ul>\n<li>Laki-laki (FE, QE, WE, SE/ Perempuan (BE, AP)</li>\n<li>Usia maximum 27 tahun</li>\n<li>S1/D3 Teknik Mesin/Kimia/Design (FE, QE, SE, BE)</li>\n<li>S1 Teknik Lingkungan (EE)</li>\n<li>D3/D4 Polman Ceper (CE)</li>\n<li>D1 (AP)</li>\n<li>Minimal IPK 2.90</li>\n<li>Mampu berbahasa Inggris lisan &amp; tulis</li>\n<li>Mampu mengoperasikan computer, Autocad dan Software Engineering (lebih diutamakan)</li>\n<li>Mampu berkomunikasi, bekerja keras &amp; kelompok, teliti, jujur</li>\n</ul>', '', '', 1592, '3', 3, 2, 0, '2013-10-16', '2013-10-31', 'mail@mail.com', 'mail@mail.com', '', 4, 0, 1),
