INSERT INTO `widget` (`id`, `nama`, `alias`, `content`, `is_html`) VALUES
(1, 'About Dunia Karir', 'about_dunia_karir', '<h1>About parapekerja.com</h1>\n<p>parapekerja.com is a site that provides updated information about job and career market. </p>\n<p>Parapekerja.com only act as a successor / provider of information and is not responsible for the contents of the relevant job openings.</p>\n<p>It is recommended for job seekers to be careful and not carelessly spreading personal information, such as identity and CV.</p> ', 0),
(2, 'Payment', 'payment', '<p><a class="discover" title="Discover" href="#">Discover</a> <a class="amex" title="Amex" href="#">Amex</a> <a class="american-express" title="American Express" href="#">American Express</a> <a class="visa" title="Visa" href="#">Visa</a> <a class="pay-pal" title="Pay Pal" href="#">Pay Pal</a> <a class="master-card" title="Master Card" href="#">Master Card</a></p>', 0),
