(4, 'Iphone', 'iphone', '<br/>\n<img src="http://tahniah.com/banner.gif"><br/><br/>', 0),
(5, 'Create Account', 'create_account', '<h1><span style="font-size: medium;">Join Parapekerja Today</span></h1>\n<ul>\n<li>Kirim aplikasi lamaran kerja kamu ke <span style="color: #ff0000;"><strong>Email</strong></span> perusahaan dengan aplikasi dari parapekerja.com</li>\n<li>Gratis</li>\n</ul>', 1),
(6, 'Social Link', 'social_link', '<div style="padding-top:2px;">\r\n<a class="rss" title="Feed Parapekerja.com" href="http://www.parapekerja.com/rss" target="new">RSS</a> \r\n<a class="flickr" title="Flickr" href="http://www.parapekerja.com" target="new">Flickr</a> \r\n<a class="facebook" title="parapekerja Facebook" href="http://www.facebook.com/parapekerja">Facebook</a> \r\n<a class="google" title="Google" href="http://www.parapekerja.com" target="new">Google</a> \r\n<a class="last-fm" title="Last FM" href="http://www.parapekerja.com" target="new">Last FM</a> \r\n<a class="twitter" title="Twitter" href="http://www.twitter.com/parapekerja" target="new">Twitter</a> \r\n</div>', 0),
(7, 'Membership Invoice', 'membership-invoice', 'Status membership anda akan segera kami update.. <br /><br />  \n\nTerima Kasih <br /><br />\n\nAdmin - Titis Lestari <br /><br />', 0),
(8, 'Apply Vacancy', 'apply_vacancy', '<p>Dear Sir/Madam,</p>\n<p>Berikut informasi pemberitahuan adanya pelamar yang melamar lowongan yang telah anda kirimkan pada parapekerja.com.</p>\n<p>Terima Kasih</p>', 1),
(9, 'Seeker Sent Mail', 'seeker-sent-mail', '<br/><br/>\nPemberitahuan : email tersebut di atas tidak di peruntukan kepada perorangan, akan tetapi di tujukan untuk lamaran ke perusahaan, apabila anda menerima email tersebut di atas dengan isi ajakan untuk test wawancara, permintaan uang, Kami pastikan itu adalah penipuan, mohon laporkan alamat email dia, team kami akan segera menghapus akun dia dari parapekerja.com', 0),
(10, 'Default Resume', 'default-resume', 'Dear Sir/Madam,\r\n\r\nI wish to apply for the position above, as advertised on parapekerja.com on [DD FF YYYY].\r\n\r\n[Please add your message here.]\r\n\r\nThank you.\r\n\r\nSincerely\r\n[Your Name]', 0),
